import { Form } from "react-bootstrap";


function OTP1(){
    return(
        <div style={{backgroundColor:"skyblue",padding:"20px"}}>
            <br/><br/><br/>
            <h4>Get started</h4>
            <br/><br/>
            <Form>
                <input style={{padding:"5px"}} type="text" placeholder="Mobile/Email"/><br/><br/>
                <button style={{width:"195px",padding:"5px",backgroundColor:"lightblue",marginTop:"-28px"}}>Continue</button>
<br/><br/>
or Continue with<br/><br/>
<button style={{color:"green"}}>Whatasapp</button>&ensp;<button  style={{color:"blue"}}>Google</button>
<br/><br/>
By Continuing you agree to our terms and polices

            </Form>
            
        </div>
    )
}
export default OTP1;
